{
  homebrew = {
    enable = true;
    onActivation = {
      autoUpdate = true;
      cleanup = "uninstall";
    };
    taps = [
      "trasta298/tap"
    ];
    brews = [
      "trasta298/tap/keifu"
    ];
    casks = [
      # System Integration (カーネル拡張・システムサービス)
      "1password"
      "karabiner-elements"
      "bettertouchtool"
      "elgato-stream-deck"
      "gpg-suite"
      "orbstack"
      "tailscale"
      "blackhole-2ch"

      # Browsers
      "google-chrome"

      # Communication
      "discord"
      "element"
      "mattermost"
      "nani"
      "signal"
      "simplex"
      "slack"
      "telegram"
      "wechat"

      # AI / LLM
      "chatgpt"
      "claude"

      # Productivity
      "anki"
      "figma"
      "linear-linear"
      "notion-calendar"
      "obsidian"

      # Development
      "android-studio"
      "ghostty"
      "proxyman"
      "tableplus"

      # Media
      "krita"
      "spotify"
      "vlc"
      "ogdesign-eagle"

      # Utilities
      "appcleaner"
      "raycast"
      "screen-studio"
      "stats"
      "yubico-authenticator"

      # Complex Installers
      "adobe-acrobat-reader"
      "adobe-creative-cloud"
      "microsoft-auto-update"
      "qgis"

      # Hardware
      "arduino-ide"
      "ledger-live"
      "qmk-toolbox"

      # Other
      "bitcoin-core"
      "keybase"
      "sidequest"
      "tor-browser"
      "virtual-desktop-streamer"
      "zoom"
    ];

    # TODO: masApps は Homebrew の mas (1.8.6) が古く `get` コマンド未対応のため無効化
    # Homebrew の mas が 5.x に更新されたら復活させる
